foreach (var group in patternGroups)
{
    WriteLine();
    WriteLine($"occurrence of {group.Key} bits has {group.Count()} patterns.");
    var matches = group.AsParallel().Select(r => new KeyValuePair<long, List<List<int>>>(r.Value, drawPatterns.Where(p => Match(r.Value, p)).Select(Draw).ToList()))
        .ToList();
    WriteLine($"Number of patterns checked is {matches.Count} patterns. This timing matters.");
    var max = matches.Max(r => r.Value.Count);
    var maxMatches = matches.Where(r => r.Value.Count == max).OrderBy(r => r.Key).ToList();
    WriteLine($"Highest number of matches is {max} draws in {maxMatches.Count()} patterns.");
    foreach (var pair in maxMatches)
    {
        WriteLine($"* Pattern {string.Join(", ", Draw(pair.Key))} occurs {pair.Value.Count} times.");
        if (maxMatches.Count() <= 5 && pair.Value.Count < 10)
        {
            foreach (var draw in pair.Value) WriteLine($"* * Draw {string.Join(", ", draw)}.");
        }
    }
    WriteLine($"Finished for {group.Key} bits.");
}
Console.WriteLine($"Process took [{time.ElapsedMilliseconds,4:0} ms, {time.ElapsedTicks,7:0} ticks]");
return;

bool Match(long pattern, long other) { return (pattern & other) == pattern; }
long Pattern(List<int> draw) { return draw.Aggregate<int, long>(0, (current, i) => current | (1L << i)); }

List<int> Draw(long pattern)
{
    var result = new List<int>();
    for (var i = 0; i < 64; i++)
        if ((pattern & (1L << i)) != 0)
            result.Add(i);
    return result;
}

int BitCount(long pattern)
{
    var result = 0;
    while (pattern > 0)
    {
        if ((pattern & 1) == 1) result++;
        pattern >>= 1;
    }
    return result;
}

void WriteLine(string? value = "")
{
    Console.WriteLine($"[{time.ElapsedMilliseconds - lastElapsed,4:0} ms, {time.ElapsedTicks - lastTicks,7:0} ticks] {value}");
    lastElapsed = time.ElapsedMilliseconds;
    lastTicks = time.ElapsedTicks;
}
